import * as React from 'react';
import Box from '@mui/material/Box';
import SpeedDial from '@mui/material/SpeedDial';
import SpeedDialAction from '@mui/material/SpeedDialAction';
import FavoriteIcon from '@mui/icons-material/FavoriteBorder';
import CheckIcon from '@mui/icons-material/Check';
import { Facebook, Instagram, Pinterest, Twitter } from 'react-bootstrap-icons';
import { makeStyles } from '@mui/material';
import { border } from '@mui/system';




const useStyles = makeStyles ({
  root: {
    border: 0,
    borderRadius: 15,
    color: 'white',
    padding: 0
  }
})

const actions = [
  { icon: <Facebook />, name: 'Facebook' },
  { icon: <Instagram />, name: 'Instagram' },
  { icon: <Twitter />, name: 'Twitter' },
  { icon: <Pinterest />, name: 'Pinterest' },
];



export default function SpeedMenu() {

  return (



    <Box sx={{ height: 320, transform: 'translateZ(0px)', flexGrow: 1}}>
      <SpeedDial
        ariaLabel="SpeedDial openIcon example"
        sx={{ position: 'absolute', bottom: 15, right: 5 }}
        icon={<FavoriteIcon className='speedIcon' openIcon={<CheckIcon />} />}
      >
        {actions.map((action) => (
          <SpeedDialAction
            key={action.name}
            icon={action.icon}
            tooltipTitle={action.name}
          />
        ))}
      </SpeedDial>
    </Box>
  );
}
